import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';


function Navv() {
  return (
    <Navbar  style={{backgroundColor:'#CD5C5C',margin:'0',padding:'0',height:'90px',borderRadius:'15px'}}>
      <Container fluid>
        <Navbar.Brand style={{ fontSize: '27px',c}}>Ecommerce store</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
            <Nav.Link >Home</Nav.Link>
            <Nav.Link href="#action2">products</Nav.Link>
           <Nav.Link  disabled>Cart</Nav.Link>
           <Nav.Link  disabled>signup</Nav.Link>
          </Nav>
          <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success">Search</Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default  Navv;
